import React from 'react';
import './NavBar.css';


const NavBar = () => {
    return (
        <header className={'header'}>
            <img className={'logo'} src="Images/logo.png"  alt="app logo"/>
            <h1 className={'app-name'}>NotesApp</h1>

            <nav>
                <li>Actual</li>
                <li>Archive</li>
            </nav>

            <button className={'create-btn'}>Create</button>

        </header>
    );
};

export default NavBar;
